import Footer from "../components/Footer";
import HeroPages from "../components/HeroPages";
import Person1 from "../images/team/1.png";
import Person2 from "../images/team/2.png";
import Person3 from "../images/team/3.png";
import Person4 from "../images/team/4.png";
import Person5 from "../images/team/5.png";
import Person6 from "../images/team/6.png";

function Team() {
  const teamPpl = [
    {
      img: Person1, 
      name: "Rishi Kandagatla", 
      job: "Visionary Designer & Mastermind"
    },
  ];

  return (
    <>
      <section className="team-page">
        <HeroPages name="Meet the Mastermind" />
        <div className="container">
          <div className="team-container">
            {teamPpl.map((ppl, id) => (
              <div key={id} className="team-container__box">
                <div className="team-container__box__img-div">
                  <img src={ppl.img} alt="team_img" />
                </div>
                <div className="team-container__box__descr">
                  <h3>{ppl.name}</h3>
                  <p>{ppl.job}</p>
                  <p className="team-highlight">
                    The driving force behind every pixel, every curve, and every
                    detail you see. Rishi doesn’t just design—he **creates
                    experiences**, turning imagination into digital reality.
                  </p>
                  <p className="team-highlight">
                    A perfectionist, a creator, and a trailblazer—this entire
                    platform is the **vision of one mind, one soul, one
                    legend.**
                  </p>
                  <p className="team-highlight">
                    “Design is not just what it looks like and feels like. 
                    Design is how it **speaks** to you.” — Rishi Kandagatla
                  </p>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="book-banner">
          <div className="book-banner__overlay"></div>
          <div className="container">
            <div className="text-content">
              <h2>Book a car by getting in touch with us</h2>
              <span>
                <i className="fa-solid fa-phone"></i>
                
              </span>
            </div>
          </div>
        </div>

        <Footer />
      </section>
    </>
  );
}


export default Team;
